import React, { Component } from 'react';
import './App.css';

class BudgetComponent extends Component {
  constructor (props) {
    super(props)
    this.state = {
      response: '',
      post: '',
      responseToPost: '',
      keyword: ''
    }
  }

  render() {
    return (
      <div className="budget-container">
        <div>
        {
          [1,2,3,4].map((key, i) => 
            <div key={i} className='budget-list-div'>
              <div className='budget-topic-list-div'>
                <div>
                  ไป 
                </div>
                <div>ราคา</div>
              </div>
              <div className='budget-body-list-div'>
                <div>
                  บินวันที่ departureDate
                  โดยสารการบิน
                </div>
                <div>
                  กลับวันที่ arrivalDate
                  โดยสารการบิน
                </div>
              </div>
            </div>
          )
        }

        </div>
        Hello
      </div>
    );
  }
}

export default BudgetComponent
